import React from 'react';
function Team(){
    return(
        <>
        <div>
            <h2>Contact Information</h2>
            <p>Do you find this tool useful? Find a bug? 
                Have a feature request? Drop me a line and let me know!
            </p>
            <br/><br/>
            <p>Harjot Singh Dhillon</p>
            <p>Jan Nayak Ch. Devilal Memorial College Of Engineering,</p>
            <p>Department of Computer Science</p>
            <p>Chaudhary Devilal University</p>
            <p>Sirsa(125055),Haryana</p>

            <p>8572884654
                i_am_harjot@outlook.com
            </p>
        </div>
        </>
    );
}
export default Team;
